•neither EBITDA nor EBITDA As Defined reflects the significant interest expense, or the cash requirements, necessary to service interest payments on our indebtedness;
•although depreciation and amortization are non-cash charges, the assets being depreciated and amortized will often have to be replaced in the future, and neither EBITDA nor EBITDA As Defined reflects any cash requirements for such replacements;
•the omission of the substantial amortization expense associated with our intangible assets further limits the usefulness of EBITDA and EBITDA As Defined;
•neither EBITDA nor EBITDA As Defined includes the payment of taxes, which is a necessary element of our operations; and
•EBITDA As Defined excludes the cash expense we have incurred to integrate acquired businesses into our operations, which is a necessary element of certain of our acquisitions. Because of these limitations, EBITDA and EBITDA As Defined should not be considered as measures of discretionary cash available to us to invest in the growth of our business. Management compensates for these limitations by not viewing EBITDA or EBITDA As Defined in isolation and specifically by using other U.S. GAAP measures, such as net income, net sales and operating profit, to measure our operating performance. Neither EBITDA nor EBITDA As Defined is a measurement of financial performance under U.S. GAAP, and neither should be considered as an alternative to net income or cash flow from operations determined in accordance with U.S. GAAP. Our calculation of EBITDA and EBITDA As Defined may not be comparable to the calculation of similarly titled measures reported by other companies.
